function consts_random_string($ascii_min, $ascii_max) {
  $string_length = random_int(22,30);
  $string_random = "";

  for ($n=0; $n < $string_length; $n++) {
    $string_random .= chr(random_int($ascii_min, $ascii_max));
  }

  return $string_random;
}
